import React from "react";
import Navbar from "../../Components/NavBar/Navbar";
import Footer from "../../Components/Footer/Footer";
import { Listing } from "../../Components/Listing/Selecting";
function Selections() {
  return (
    <>
      <Navbar />
      <Listing />
      <Footer />
    </>
  );
}

export default Selections;
